const char *solaris_object_type_to_string(enum solaris_object_type type) {
	switch (type) {
	    case OBJECT_TYPE_GALAXY:
	        return "Galaxy";
	    case OBJECT_TYPE_UNIDENTIFIED:
	        return "Unidentified";
	    case OBJECT_TYPE_NONEXISTENT:
	        return "Nonexistent";
	    case OBJECT_TYPE_REFLECTION_NEBULA:
	        return "Reflection Nebula";
	    case OBJECT_TYPE_SINGLE_STAR:
	        return "Single Star";
	    case OBJECT_TYPE_DOUBLE_STAR:
	        return "Double Star";
	    case OBJECT_TYPE_ASTERISM:
	        return "Asterism";
	    case OBJECT_TYPE_PLANETARY_NEBULA:
	        return "Planetary Nebula";
	    case OBJECT_TYPE_UNCERTAIN:
	        return "Uncertain";
	    case OBJECT_TYPE_GLOBULAR_STAR_CLUSTER:
	        return "Globular Star Cluster";
	    case OBJECT_TYPE_OPEN_STAR_CLUSTER:
	        return "Open Star Cluster";
	    case OBJECT_TYPE_CLUSTER:
	        return "Cluster";
	    case OBJECT_TYPE_TRIPLE_STAR:
	        return "Triple Star";
	    case OBJECT_TYPE_KNOT:
	        return "Knot";
	    case OBJECT_TYPE_PHOTOGRAPHIC_PLATE_DEFECT:
	        return "Photographic Plate Defect";
		default:
			return "unknown";
	}
}

const char *solaris_catalog_type_to_string(enum solaris_catalog_type type) {
	switch (type) {
	    case CATALOG_INDEX_CATALOG:
	        return "Index Catalog";
	    case CATALOG_NEW_GENERAL_CATALOG:
	        return "New General Catalog";
		default:
			return "unknown";
	}
}

